import { award } from "../award"
import { blog } from "../blog"
import { blog_single } from "../blog-single"
import { Contact } from "../contact"
import { Home } from "../Home"
import { AWARD_ROUTE, BLOG_ROUTE, BLOG_SINGLE_ROUTE, CONTACT_ROUTE, HOMEPAGE_ROUTE } from "./utils/consts"


export const authRoutes = [
    
]
export const publicRoutes = [
    {
        path: HOMEPAGE_ROUTE,
        Component : Home
    },
    {
        path: BLOG_ROUTE,
        Component : blog  
    },
    {
        path: AWARD_ROUTE,
        Component : award  
    },
    {
        path: CONTACT_ROUTE,
        Component : Contact  
    },
    {
        path: BLOG_SINGLE_ROUTE + '/:id',
        Component : blog_single  
    }

]
